- input: "TEXT\x1CC00440818\x1C.TEXT\x1C\x1CF3A\x1CIn response to the FEC letter of
    September 10, 2008, we are electronically filing amended reports to correct the
    contribution errors and election designations on previous reports due to inaccurate
    designation by the preparer of the proper election designation (confusion was
    due to fact that candidate ran in a special primary and special run-off election,
    but FEC election designation categories listed special-primary and special-general,
    as well as run-off; therefore, our preparer incorrectly designated run-off contributions
    as special-general rather tahn run-off; this amendment attempts to correct those
    designations as originally intended by contributors.  We are also immediately
    returning the following contributions with campaign checks issued, dated and dispatched
    October 10, 2008; Dennis A. Pasentine $2,277, Russell J. Flowers, $2,300  and
    Karen R. Burns $201.  If you desire additional information, do not hesitate to
    contact us. Tim Burns for Congress    "
